import "./Login.css";

const Login = () => {
	return (
		<div className="maincontainer">
		  <div className="card">
		    <div className="front">
				<h1>Front of Card</h1><a href="#btnLeft">hello</a>
			</div>
			 <div className="back">
				 <a href="#btnLeft">hola</a>
			</div>
		  </div>
        </div>		  
	);
}

export default Login;
